//**** Mixins for Layout ***

@mixin flexTool($direction){
    display: flex;
    flex-direction: $direction;
    justify-content: center; 
    align-items: center; 
    }
@mixin img_size{
    width: 100%;
    height: 200px;
    object-fit: cover;
    border-radius: 15px 15px 0 0;
    padding-bottom: 15px;
}
@mixin center_title{
    display: block;
    margin-left: auto;
    margin-right: auto;
}
//**** Mixins Media Querys ***

@mixin media_tablet{
    @media screen and (min-width:map-get($breakpoints, tablet)) and (max-width:map-get($breakpoints, desktop)){
        @content;
    }
}
@mixin media_desktop{
    @media screen and (min-width:map-get($breakpoints, desktop)){
        @content;
    }
}
